script: |
  super -f text -I q8351.spq | sort > q8351.out

inputs:
  - name: q8351.spq
    data: |
      SELECT + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN ( - col2 * + - CAST ( NULL AS INTEGER ) * - col1 + - - col1 / + 11 * col1 ) AND 88;
  - name: tab0

outputs:
  - name: q8351.out
    data: |
